	add("baccalaureate", "{\"term\":\"baccalaureate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027baccalauréat\u0027 () from \u0027baccalaureatus\u0027 from \u0027baccalaureus\u0027 an alteration of \u0027baccalarius\u0027 (lang\u003dla) to resemble \u0027bacca lauri\u0027 (lang\u003dla) (the ancient symbol of victory). Compare Bachelor.During the Renaissance, doctors, upon passing their final examinations, were decorated with berried branches of bay.  From this ancient custom derives the French word {{m|fr|baccalaureate}}, from the Latin \u0026quot;bacca,\u0026quot; a berry, and \u0026quot;laureus,\u0026quot; of laurel), and, by modification, the term \u0026quot;bachelor\u0026quot; in referring to a college degree. \"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bachelor degree\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A high school completion exam and qualification awarded in many countries (e.g. Finland, France, Moldova, Romania), designed to enable students to go on to higher education\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A farewell address in the form of a sermon delivered to a graduating class\", \"priority\":3}]}, \"synonyms\":{}}");

