	add("backdraft", "{\"term\":\"backdraft\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|draft|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extreme fire behavior phenomena involving ignition of products of combustion (such as carbon monoxide) and pyrolysis products upon introduction of oxygen to a compartment. In this phenomena the fuel generally is at a high temperature (above 600 degrees C), but combustion is limited by a lack of oxygen. Introduction of atmospheric oxygen results in explosive combustion\", \"priority\":1}]}, \"synonyms\":{}}");

