	add("backgammon", "{\"term\":\"backgammon\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Probably from \u0027back\u0027 + Middle english (1100-1500) {{m|enm|gamen}}, from Old english (ca. 450-1100) \u0027gamen\u0027 (lang\u003dang)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Backgammon 150px|thumb|right|A backgammon board shown in starting position\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A board game for two players in which each has 15 stones which move between 24 triangular points according to the roll of a pair of dice; the object is to move all of one\u0027s pieces around, and bear them off the board\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A victory in the game when the loser has not borne off a stone, and still has one or more stones in the winner\u0027s inner home row or on the bar\", \"priority\":3}]}, \"synonyms\":{}}");

