	add("backhoe", "{\"term\":\"backhoe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|back|hoe|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of excavating equipment consisting of a digging bucket or scoop on the end of an articulated arm, drawn backwards to move earth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A multi-purpose tractor with a front-mounted loading bucket and a rear-mounted digging bucket\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027 June, Charles E. Rhine, \u0027How to Rent a \u0027\u0027Backhoe\u0027\u0027\u0027, \u0027w:Popular Popular Science\u0027, [http://books.google.com.au/books?id\u003djSEDAAAAMBAJ\u0026amp;pg\u003dPA149\u0026amp;dq\u003d%22backhoe%7Cbackhoes%22+-intitle:%22backhoe%7Cbackhoes%22\u0026amp;hl\u003den\u0026amp;ei\u003dZnK-TsOuIKGfiAeYxPWFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22backhoe%7Cbackhoes%22%20-intitle%3A%22backhoe%7Cbackhoes%22\u0026amp;f\u003dfalse page 149\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027backhoe\u0027\u0027 is only one type of heavy equipment for rent.I heard about a couple of tool-rental outfits near Chicago that were doing a brisk business renting \u0027\u0027backhoes\u0027\u0027 and other heavy equipment to homeowner\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Dave Roberts, \u0027Pipe and Excavation Contracting\u0027, [http://books.google.com.au/books?id\u003dSJxE3N8J6VsC\u0026amp;pg\u003dPA173\u0026amp;dq\u003d%22backhoe%7Cbackhoes%22+-intitle:%22backhoe%7Cbackhoes%22\u0026amp;hl\u003den\u0026amp;ei\u003dZnK-TsOuIKGfiAeYxPWFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22backhoe%7Cbackhoes%22%20-intitle%3A%22backhoe%7Cbackhoes%22\u0026amp;f\u003dfalse page 173\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll recommend a good way to calculate \u0027\u0027backhoe\u0027\u0027 production rates. Then we\u0027ll look at the two \u0027\u0027backhoes\u0027\u0027 you\u0027ll be using, the wheeled \u0027\u0027backhoe\u0027\u0027 and the tracked \u0027\u0027backhoe\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Robert Day, \u0027Foundation Engineering Handbook\u0027, 2nd edition, [http://books.google.com.au/books?id\u003d0VtHuJNls5MC\u0026amp;pg\u003dSA2-PA49\u0026amp;dq\u003d%22backhoe%7Cbackhoes%22+-intitle:%22backhoe%7Cbackhoes%22\u0026amp;hl\u003den\u0026amp;ei\u003dMH6-Tuf0BIOtiQeAvqWhBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22backhoe%7Cbackhoes%22%20-intitle%3A%22backhoe%7Cbackhoes%22\u0026amp;f\u003dfalse page 2.49\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Backhoe\u0027\u0027 pits and trenches are an economical means of performing subsurface exploration. The \u0027\u0027backhoe\u0027\u0027 can quickly excavate the trench that can then be used to observe and test the in situ soil (see Fig. 2.29\", \"priority\":11}]}, \"synonyms\":{}}");

