	add("backlog", "{\"term\":\"backlog\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|log|lang\u003den}}. 1680s; originally a large log at the back of a fire. Figurative sense from 1880s, meaning “ something stored up for later use”. Possibly influenced by logbook as well.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An accumulation or buildup, especially of unfilled orders or unfinished work\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He went to work on Saturday to try to work through the \u0027\u0027backlog\u0027\u0027 of papers on his desk\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In visual novels, a log contaning text previously read\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A reserve source or supply\", \"priority\":4}]}, \"synonyms\":{}}");

