	add("backness", "{\"term\":\"backness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027back\u0027 and \u0027-ness\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Quality of being a back vowel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Andrew Spencer (1996), \u0027Phonology: theory and description\u0027, p. 25\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The most important aspects of vowel quality are tongue height, frontness/\u0027\u0027backness\u0027\u0027 and lip rounding\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backpack", "{\"term\":\"backpack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"back + pack\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A knapsack, sometimes mounted on a light frame, but always supported by straps, worn on a person’s back for the purpose of carrying things, especially when hiking, or on a student\u0027s back when carrying books\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A similarly placed item containing a parachute or other life-support equipment\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backpropagation", "{\"term\":\"backpropagation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|propagation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An error correction technique used in neural network\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A phenomenon in which the action potential of a neuron creates a voltage spike both at the end of the axon, as normally, and also back through to the dendrites from which much of the original input current originated\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backquote", "{\"term\":\"backquote\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The symbol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Wendy L Milner, \u0027Common Lisp: A Tutorial\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The form that follows the \u0027\u0027backquote\u0027\u0027 is not evaluated, except for certain items\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backreference", "{\"term\":\"backreference\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|reference|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An item in a regular expression equivalent to the text matched by an earlier pattern in the expression\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Rob Brooks-Bilson, \u0027Programming ColdFusion MX\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The third part of the regular expression, 1, is the \u0027\u0027backreference\u0027\u0027 and tells ColdFusion to refer back to the first subexpressio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Ivan Ristic, \u0027Apache security\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Path traversal occurs when directory \u0027\u0027backreferences\u0027\u0027 are used in a path to gain access to the parent folder of a subfolder\", \"priority\":5}]}, \"synonyms\":{}}");

	add("backrest", "{\"term\":\"backrest\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|rest|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The back piece of a chair, used to support the sitter\u0027s back\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A guide attached to the slide rest of a lathe, and placed in contact with the work to steady it in turning\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backscatter", "{\"term\":\"backscatter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|backscattering|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The deflection of particles and/or radiation through angles greater than 90 degrees to the original direction of travel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The particles and/or radiation deflected in this manner\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A portion of the energy of electromagnetic radiation such as a laser or radio waves that is scattered back in the direction of the source of radiation by an obscurant\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The sending of IP packets to essentially random addresses in response to incoming packets that have a spoofed origin\", \"priority\":4}]}, \"synonyms\":{}}");

	add("backscroll", "{\"term\":\"backscroll\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|scroll|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"scrollback\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backset", "{\"term\":\"backset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A check; a relapse; a discouragement; a setback\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Whatever is thrown back in its course, such as water\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Harper\u0027s Magazine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Slackwater, or the \u0027\u0027backset\u0027\u0027 caused by the overflow\", \"priority\":4}]}, \"synonyms\":{}}");

	add("backshift", "{\"term\":\"backshift\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|shift|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The changing of the tense of a verb from present to past in reported speech\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A function on a whose value on any random variable is the preceding random variable in the process\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backshore", "{\"term\":\"backshore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|shore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An upper shore zone above high-tide\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backside", "{\"term\":\"backside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The side of something that is opposite the front\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027backside\u0027\u0027 of the building faced an alley, and was covered in grime and scrawled graffiti\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The buttocks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"After riding the horse all day for the first time, I had painful blisters on my \u0027\u0027backside\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, w:Paul Doyle Paul Doyle, \u0026quot;[http://www.theguardian.com/football/2014/oct/18/southampton-sunderland-premier-league-match-report Southampton hammer eight past hapless Sunderland in barmy encounter]\u0026quot;, \u0027The Guardian\u0027, 18 October 2014\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"There was a whiff of farce about Southampton’s second goal too, as, six minutes later, a bungled Sunderland pass ricocheted off Will Buckley’s \u0027\u0027backside\u0027\u0027 to the feet of Dusan Tadic\", \"priority\":6}]}, \"synonyms\":{}}");

	add("backsies", "{\"term\":\"backsies\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|back|sies|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reciprocal action or consequence, such as immediately tagging the player who has tagged one in a game of tag\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Carolyn W. Field, Jaqueline Shachter Weiss, \u0027Values in selected children\u0027s books of fiction and fantasy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Frances is the loser when she agrees to no \u0026quot;\u0027\u0027backsies\u0027\u0027\u0026quot; or refunds as she buys Thelma\u0027s plastic tea dishes with money saved for a china set\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jenna Katerin Moran, \u0027Nobilis: The Essentials, Volume 1\u0027, page 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Then you will be in trouble because it will kill you to have it taken out again but it will betray your deepest inner truth to tell them No \u0027\u0027Backsies\", \"priority\":5}]}, \"synonyms\":{}}");

	add("backsight", "{\"term\":\"backsight\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|sight|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The rear sight of a firearm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A measurement or reading taken back towards a point of known elevation, used to calculate the height of the surveying instrument (theodolite, transit, total station\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A measurement of a previously shot point, used to set the angle to zero when occupying a new position\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backslang", "{\"term\":\"backslang\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|back|slang|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of slang in which the spelling of words is reversed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"pig Latin\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backslash", "{\"term\":\"backslash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|slash|lang\u003den}}, because it is a slash going back against the direction of writing, in contrast to the common slash \u0027/\u0027 (slash, solidus, oblique, forward slash)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The punctuation mark\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, James T. Bretzke, \u0027Bibliography on East Asian Religion and Philosophy\u0027, Edwin Mellen Press, ISBN 0-7734-7318-1, [http://books.google.com/books?id\u003dKXwp_xwbHrcC\u0026amp;pg\u003dPA455\u0026amp;dq\u003dbackslash page 455\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I was trying to find a web-site for which I had been given the following address: \u0027http://\u0026lt;nowiki/\u0026gt;www.isop.ucla.edu/pacrim/pubs/korjournal.htm\u0027. I began to work backwards, removing first the last part of the address following the last \u0027\u0027backslash\u0027\u0027 (\u0027/korjournal.htm\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Lee Vance, \u0027The Garden of Betrayal\u0027, Random House (2011), ISBN 978-0-307-39035-6, [http://books.google.com/books?id\u003dCXzvPfYaJWsC\u0026amp;pg\u003dPA25\u0026amp;dq\u003dbackslash page 25\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“So, do what I tell you. Open a browser window and type this in the menu bar: F-T-P colon \u0027\u0027backslash\u0027\u0027 \u0027\u0027backslash\u0027\u0027 euronews dot net \u0027\u0027backslash\u0027\u0027...” \u0026lt;!--note: ellipsis in original--\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I pecked carefully at the keyboard as he dictated a URL that was about fifty characters long\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Frank Barnas and Ted White, \u0027Broadcast News Writing, Reporting, and Producing\u0027, Fifth Edition, Elsevier, ISBN 0080953972, [http://books.google.com/books?id\u003dIZoOxPievkYC\u0026amp;pg\u003dPT205\u0026amp;dq\u003dbackslashes page 114\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Also, avoid submenus that can confuse the audience—if you\u0027re giving lengthy Web site addresses full of \u0027\u0027backslashes\u0027\u0027, shorten it so only the Web site\u0027s home page is given\", \"priority\":8}]}, \"synonyms\":{}}");

	add("backspace", "{\"term\":\"backspace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|space|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The key on a typewriter that moves the head one position backwards\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A keyboard key used for removing a character behind the cursor, and moving the cursor one position backwards\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backspin", "{\"term\":\"backspin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Spin applied to a ball in order to slow it, change its flight, or stop it when it lands\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backsplash", "{\"term\":\"backsplash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|splash|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vertical covering on a wall rising above a countertop or other work surface to protect the wall from spills and to decorate the wall\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backstabber", "{\"term\":\"backstabber\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From back + stab + -er\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A traitor or hypocrite, such as a co-worker or friend assumed trustworthy but who figuratively attacks when one\u0027s back is turned\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backstep", "{\"term\":\"backstep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|step|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A step backward\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Steve Scott, \u0027Winning on the Mat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The attacker steps across his body and places his right foot on the mat. As he does this, the attacker uses his left hand to pull on his opponent\u0027s right sleeve and uses his left hand to start his \u0027\u0027backstep\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An abrupt subsidence or change in deposition preserved in the sedimentary record due to a marine transgression\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Flow over a backward-facing step\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The process of going back and finishing a specification that was incomplete at the start of a process, once enough progress has been made to know the full details\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A platform at the rear of a firetruck where a firefighter can stand\", \"priority\":7}]}, \"synonyms\":{}}");

	add("backstop", "{\"term\":\"backstop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|stop|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A thing or a person put in the rear or in the back of something to reinforce, hold, support\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A wall or fence behind home plate\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A catcher; the position of catcher\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The player who stands immediately behind the striking base\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The longstop\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The wicket-keeper\", \"priority\":6}]}, \"synonyms\":{}}");

	add("backstory", "{\"term\":\"backstory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|story|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The previous life and experiences of a character in a dramatic work\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fictitious account of a person\u0027s history designed to conceal their actual history and motives; a cover story\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A prequel\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backstrap", "{\"term\":\"backstrap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|strap|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pull strap extending the backstay of a boot or shoe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The backbone of a book\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A loin of meat consisting of the muscle on each side of the spine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Guy Mirabella, \u0027Eat - Ate\u0027 (page 110\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As a dressing, combine the extra-virgin olive oil and garlic in a small bowl, seasoning with salt and pepper. Arrange the whole eggplants and tomatoes on a large platter. Slice the lamb \u0027\u0027backstraps\u0027\u0027 diagonally and lay the meat over the eggplants and tomatoes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An anchoring strap, passed around the waist or hips, for a small loom\", \"priority\":6}]}, \"synonyms\":{}}");

	add("backstream", "{\"term\":\"backstream\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|stream|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A current running against the main current of a stream; an eddy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backstretch", "{\"term\":\"backstretch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|stretch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the part of a racecourse that is farthest from the grandstand and parallel to the homestretch\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the area adjacent to a racetrack where the horses are stabled and stable employees have temporary living accommodations\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The middle part of an even\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"26 June 2014\u0027\u0027, A.A Dowd, AV Club \u0027Paul Rudd and Amy Poehler spoof rom-com clichés in They Came Together\u0027[http://www.avclub.com/review/paul-rudd-and-amy-poehler-spoof-rom-com-cliches-th-206220\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In some respects, it might be too faithful to the genre it savages; as in many real rom-coms, the energy flags during the plot’s \u0027\u0027backstretch\u0027\u0027, and audiences may share the drifting interest of Kyle (Bill Hader) and Karen (Ellie Kemper), who come to regret ever asking Joel and Molly to chronicle their meet-cute\", \"priority\":5}]}, \"synonyms\":{}}");

	add("backstroke", "{\"term\":\"backstroke\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|stroke|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swimming stroke swum lying on one\u0027s back, while rotating both arms through the water as to propel the swimmer backwards\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The pull on the tail of the rope that swings the bell through a full circle (compare handstroke\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backstroker", "{\"term\":\"backstroker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|backstroke|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A swimmer who uses the style backstrok\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backswimmer", "{\"term\":\"backswimmer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|swimmer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various aquatic insects, of the family \u0027\u0027, that swim on their backs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backswing", "{\"term\":\"backswing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|swing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The preparatory stroke preceding that which produces contact with the target. Normally associated with sports using an implement such as a bat, club, racket or stick\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backsword", "{\"term\":\"backsword\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|sword|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sword with one sharp edge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1884\u0027\u0027: Robert F. Burton, \u0027The Book of the Sword\u0027, page 140\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is a thick, heavy backsword, eighteen inches long, with a bevel where the point should be, worn at the waist in a half-scabbard of wood, and used for digging as well as killing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A stick with a basket handle, used in rustic amusements.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The game in which the stick is used.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("backtag", "{\"term\":\"backtag\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|tag|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An identifying tag affixed to the back of an animal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backtalk", "{\"term\":\"backtalk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|talk|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Verbal impudence or argumentative discourse, given in response\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t give me any \u0027\u0027backtalk\u0027\u0027; just go clean your room\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backtick", "{\"term\":\"backtick\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The symbol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Lincoln D Stein, \u0027Network Programming with Perl\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027backtick\u0027\u0027 acts like the double-quote operator\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backtrack", "{\"term\":\"backtrack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of backtrac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"backtracking\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backup", "{\"term\":\"backup\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|up|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A reserve or substitute\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If the goalkeeper is injured, we have a \u0027\u0027backup\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A copy of a file or record, stored separately from the original, that can be used to recover the original if it is destroyed or damaged\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"After the power failure, we had to restore the database from \u0027\u0027backup\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An accumulation of material that halts the flow or movement of something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The blockage caused a \u0027\u0027backup\u0027\u0027 in the plumbing\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"reinforcement\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He\u0027s got a gun - you better send for \u0027\u0027backup\", \"priority\":8}]}, \"synonyms\":{}}");

	add("backveld", "{\"term\":\"backveld\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|veld|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Backward and unsophisticated rural areas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, \u0027A Dry White Season\u0027, Vintage 1998, p. 20\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If it hadn\u0027t been for Susan he might have ended his life in some small, forgotten \u0027\u0027backveld\u0027\u0027 village, quietly content to teach a bit of history and geography to one generation of school children after the other […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backwardation", "{\"term\":\"backwardation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|backward|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The situation in a futures market where prices for future delivery are lower than prices for immediate (or nearer) delivery. Generally arising from a near-term shortage of a commodity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991: \u0027gold has never gone into backwardation in any currency\u0027 \u0026amp;mdash; Reginald H. Howe, \u0027The Golden Sextant\u0027 [http://www.goldensextant.com/goldensextant.html]\u0026lt;!-- see 1913 Encylopedia Britannica for this usage --\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"fee paid by a seller on settlement day either to the buyer or to a third party who lends stock, when the seller wishes to defer settlement until the next settlement day\", \"priority\":3}]}, \"synonyms\":{}}");

	add("backwardness", "{\"term\":\"backwardness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|backward|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being backward\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"reluctance\", \"priority\":2}]}, \"synonyms\":{}}");

	add("backwash", "{\"term\":\"backwash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The backward flow of water from oars or propeller or breaking waves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The similar flow of air from an aircraft engine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result or consequence of an event; an aftermath\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The saliva, spit or food particles that have flowed back into a drink after someone has drunk from it\", \"priority\":4}]}, \"synonyms\":{}}");

