	add("backwashing", "{\"term\":\"backwashing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|back|washing|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of water treatment in which water is pumped backwards through the filter media, sometimes with intermittent use of compressed air\", \"priority\":1}]}, \"synonyms\":{}}");

	add("backwoods", "{\"term\":\"backwoods\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|back|woods|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Partly or wholly uncleared forest, especially in North America\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A remote or sparsely inhabited region, especially in North America; away from big towns and from the influence of modern life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1834\u0027\u0027, \u0027A Narrative of the Life of\u0027, Nebraska 1987, p.22\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"about that time, you mayreckon, if like me you belong to the \u0027\u0027back-woods\u0027\u0027, that I began to make up my acquaintance with hard times, and a plenty of them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was not far from the house; but the ground sank into a depression there, and the ridge of it behind shut out everything except just the roof of the tallest hayrick. As one sat on the sward behind the elm, with the back turned on the rick and nothing in front but the tall elms and the oaks in the other hedge, it was quite easy to fancy it the verge of the prairie with the \u0027\u0027backwoods\u0027\u0027 close by\", \"priority\":5}]}, \"synonyms\":{}}");

	add("backwoodsman", "{\"term\":\"backwoodsman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|backwoods|man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who is acclimated to living in a forest area that is far removed from civilization or modern conveniences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An uncivilized person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Peer who is seldom present in the House of Lords of the United Kingdom Parliament, who may be encouraged to attend when a very important vote is expected\", \"priority\":3}]}, \"synonyms\":{}}");

