	add("bacon", "{\"term\":\"bacon\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old high german (ca. 750-1050)\", \"swiss german\", \"Dutch\", \"old saxon\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027bacon\u0027 (meat from the back and sides of a pig) from Anglo-norman \u0027bacon\u0027 \u0027bacun|lang\u003dfro\u0027 () from Old Low Frankish {{m|frk|*bakō||ham, flitch}}, from Proto-germanic {{m|gem-pro|*bakô}}, {{m|gem-pro|*bakkô||back}}, from Proto-indo-european {{m|ine-pro|*bhAg-||back, buttocks}}. Cognate with Old high german (ca. 750-1050) \u0027bahho\u0027 \u0027bacho\u0027 (back, ham, side of bacon) (compare Swiss german \u0027bache\u0027 \u0027bachen\u0027 , Old saxon \u0027baco\u0027 (back) Dutch \u0027bake\u0027 (side of bacon, ham) Old english (ca. 450-1100) \u0027bæc\u0027 (back) More at {{l|en|back}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cured meat from the sides, belly or back of a pig\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thin slices of the above in long strips\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A term of endearment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"my sweet \u0027\u0027bacon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A saucisse\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The police. \u0026lt;!--from earlier slang term \u0026quot;pig\u0026quot;--\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Run! It\u0027s the \u0027\u0027bacon\", \"priority\":7}]}, \"synonyms\":{}}");

