	add("bacterium", "{\"term\":\"bacterium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From from Ancient greek (to 1453) \u0027βακτήριον\u0027 (small staff) from \u0027βακτηρία\u0027 () + \u0027-ium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single celled organism with cell walls but no nucleus or organelles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003dPlastics are energy-rich substances, which is why many of them burn so readily. Any organism that could unlock and use that energy would do well in the Anthropocene. Terrestrial \u0027\u0027bacteria\u0027\u0027 and fungi which can manage this trick are already familiar to experts in the field\", \"priority\":2}]}, \"synonyms\":{}}");

